INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`, `sort_order`, `created_at`, `updated_at`) VALUES
(10, 1, 'Who are we and what do we do?', 'We are Event Kaboodles LLC, a micro-business serving the Bay Area that rents event equipment for your backyard events and beyond.', 3, '2025-12-10 11:38:21', '2025-12-18 08:54:50'),
(11, 1, 'Where are we and how far we go?', 'We are in Fremont, CA, the happiest city in America, as per the 2025 WalletHub study. We serve pretty much all of the Bay Area, including the East Bay and Tri-Valley.', 4, '2025-12-10 11:38:39', '2025-12-18 08:55:12'),
(12, 1, 'What we don\'t do (yet) ?', 'Believe us, we want to do decor, catering, DJ, bouncy house, interiors, remodelling, run a state, but at this time we are limited to event equipment rentals like chairs, tables, etc.', 5, '2025-12-10 11:38:54', '2025-12-18 08:55:28'),
(13, 1, 'Is this FAQ Event Equipment Bible?', 'We wish it were, but we strive to keep it updated and enhance it as soon as we find something missing.\r\nSo, apologies if you don\'t find the information you are looking for.\r\nShoot us an email at\r\n<a href=\"mailto:FAQ@eventkaboodles.com\">FAQ@eventkaboodles.com</a>\r\nor call us at\r\n<a href=\"tel:5108270673\">(510)-827-0673</a>\r\nwith your feedback and suggestions.', 6, '2025-12-10 11:39:08', '2025-12-18 09:23:14'),
(14, 1, 'What really is Event Kaboodle?', 'Think of Event Kaboodles as a Box of all, or most of your event equipment stored at one common place, which you take, use it and return it to use again for your next event. Kaboodles is that Box or storage location that you can select and rent out items from that you need for your event.', 7, '2025-12-10 11:39:21', '2025-12-18 08:56:05'),
(15, 1, 'What all Event Equipment items does a Kaboodle have?', 'A Kaboodles typically has event items like Standard Folding Chairs, Folding Tables, Kids Chairs and Tables, Wedding Chairs and Tables, Pop-up Tents, Electric Patio Heaters, Backdrop and much more for rent. All this event equipment is portable, easy and convenient to haul into your car/truck for your event needs.', 8, '2025-12-10 11:39:38', '2025-12-18 08:56:24'),
(16, 1, 'Is a Kaboodle Open and accessible at all times?', 'We may very well one day, but at this time, Fremont Kaboodle observes certain timings. We are operational from <b>8:00 am until 7:00 pm</b> daily unless otherwise notified.', 9, '2025-12-10 11:40:07', '2025-12-18 08:56:42'),
(17, 1, 'How do you contact a live person at Event Kaboodles?', 'Fremont Kaboodles - Everyday <b>8:00 am to 7:00 pm</b>, Email: <a href=\"mailto://contactus@eventkaboodles.com\" target=\"_blank\">contactus@eventkaboodles.com,</a>&nbsp;Phone No: (510)-827-0673', 10, '2025-12-10 11:40:19', '2025-12-18 09:01:57'),
(18, 2, 'What is our email and Phone No. to contact?', '<p>\r\n  Email:\r\n  <a href=\"mailto:contactus@eventkaboodles.com\">\r\n    contactus@eventkaboodles.com</a>,\r\n  Phone No:\r\n  <a href=\"tel:5108270673\" onclick=\"window.location.href=\'tel:5108270673\'\">\r\n    (510)-827-0673\r\n  </a>\r\n</p>', 11, '2025-12-10 11:40:39', '2025-12-18 09:22:26'),
(19, 2, 'What is our preferred communication method?', 'We work hard on our online ordering system to ensure you don\'t have to talk to us, but if needed, we are there to listen and help. Call us at <b>(510)-827-0673</b>.', 12, '2025-12-10 11:40:52', '2025-12-18 08:57:19'),
(20, 2, 'What are the calling hours and days?', 'Every day,&nbsp;<b>8:00 am to 7:00 pm,</b> except when we cannot attend (yes, sometimes we need a break!).', 13, '2025-12-10 11:41:03', '2025-12-18 08:57:59'),
(21, 2, 'How do we at Event Kaboodles reach out to you (our customer)?', 'We like emails for sharing order status updates and progress. We don\'t like calling, but if we do, it would be for some urgent reason.', 14, '2025-12-10 11:41:16', '2025-12-18 08:58:19'),
(22, 3, 'Can i place order by calling?', 'Phone order is a thing of the past. Instead, just go to <a href=\"https://www.eventkaboodles.com/beta/public\" target=\"_blank\">www.eventkaboodles.com</a> and order online. It is really that simple and quick!', 15, '2025-12-10 11:41:32', '2025-12-18 08:46:34'),
(23, 3, 'Is there any advantage of ordering through my account vs ordering as guest at Eventkaboodles.com ?', 'Ordering from your account is much faster as it automatically uses stored details to quickly place your order. Plus, ordering through your account may give you some discounts or offers that you may not get when ordering as a guest.', 16, '2025-12-10 11:41:44', '2025-12-18 08:58:40'),
(24, 3, 'How complex is to place order online?', '<p>Step 1: Select your Kaboodle (Fremont at this time) along with the event date and duration (in case the event is multi-day). Also, select if you want to self-pick-up/drop off or need delivery. </p><p>Step 2: Choose the items you want to rent and add them to your cart. </p><p>Step 3: Go to the cart and fill out details as needed. </p><p>Step 4: Confirm card details and accept card Authorisation. </p><p>Step 5: Place order</p>', 17, '2025-12-10 11:41:56', '2025-12-18 08:47:18'),
(25, 3, 'Explain complete ordering workflow', 'For Self Pick-up &amp; Drop-off: Place Order -&gt; Order Placed -&gt; Order Confirmed -&gt; Preparing the Order -&gt; Order Ready for self Pick-up -&gt; Order Picked-up -&gt; Order Ready for self Drop-off -&gt; Order Self Dropped-off -&gt; Order Complete\r\nFor Order Delivery: Place Order -&gt; Order Placed -&gt; Order Confirmed -&gt; Preparing the Order -&gt; Order Ready for Drop-off -&gt; Order Dropped-off --&gt; Order Ready for Pick-up --&gt; Order Picked-up --&gt; Order Complete.', 18, '2025-12-10 11:42:21', '2025-12-18 08:47:28'),
(26, 3, 'How do you know your order is confirmed', 'You would receive an email from <a href=\"mailto://eventkaboodles.com\" target=\"_blank\">eventkaboodles.com</a> about the order status changing from Placed to Confirmed.', 19, '2025-12-10 11:42:34', '2025-12-18 08:48:16'),
