(1, 'about-us', 'About Us', '<p>About Us Page Content</p>', '2025-01-06 06:09:28', '2025-03-22 07:57:16'),
(2, 'privacy-policy', 'Privacy Policy', '<p>Privacy Policy Page Content</p>', '2025-01-06 06:09:28', '2025-03-22 07:57:53'),
(3, 'terms-and-conditions', 'Terms of Use', '<header><h2>Event Kaboodles LLC - Terms of Use</h2></header>\r\n                    <main>\r\n                        <ul>\r\n                            <section>\r\n                                <h4><li>Rental Agreement</li></h4>\r\n                                <ul>\r\n                                    <li> By renting equipment and services from Event Kaboodles LLC, you (customer) agree to abide by these\r\n                                    terms and conditions. This agreement constitutes a legally binding contract between Event Kaboodles LLC\r\n                                    and the customer. </li>\r\n                                </ul>\r\n                            <section>\r\n                                <h4><li>Booking and Reservation</li></h4>\r\n                                <ul>\r\n                                    <li>Reservations should be made in advance to guarantee equipment availability for your event.</li>\r\n                                    <li>A non-refundable deposit of 25% of the final rental cost before taxes may be required to secure your reservation.</li>\r\n                                    <li>Full payment should be made no less than 7 days prior to the agreed-upon pick-up or delivery date. Failure to pay may result in automatic cancellation.</li>\r\n                                    <li>Changes to reservations are subject to equipment availability and must be communicated in writing.</li>\r\n                                    <li>Changes within 7 days of the event date may incur a 10% change fee on the final rental cost before taxes.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Delivery &amp; Pick-up</li></h4>\r\n                                <ul>\r\n                                    <li>Event Kaboodles LLC provides curb-side deliveries and pick-ups as a separate service upon request.</li>\r\n                                    <li>Deliveries and pick-ups to inaccessible locations or special areas may incur additional \"convenience\" fees.</li>\r\n                                    <li>Service times depend on venue hours (e.g., parks or community centers).</li>\r\n                                    <li>Event Kaboodles LLC reserves the right to cancel delivery services due to unforeseen circumstances.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Setup and Teardown</li></h4>\r\n                                <ul>\r\n                                    <li>Setup and teardown services for event equipment are available upon request for an additional fee.</li>\r\n                                    <li>Customers must provide clear instructions for setup and teardown.</li>\r\n                                    <li>Equipment must be ready and free from decorations, food, or drinks during teardown to avoid delays.</li>\r\n                                    <li>Delays caused by the customer may result in additional \"waiting\" charges.</li>\r\n                                    <li>Event Kaboodles LLC reserves the right to refuse or cancel services due to unforeseen circumstances.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Rental Period</li></h4>\r\n                                <ul>\r\n                                    <li>The rental period begins on the agreed-upon date and time and ends on the agreed-upon return date and time.</li>\r\n                                    <li>Late returns may result in additional charges for each day after the agreed return date.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Equipment Condition</li></h4>\r\n                                <ul>\r\n                                    <li>Equipment will be provided in good working condition and should be returned in the same condition.</li>\r\n                                    <li>Customers are responsible for any damage or loss of equipment during the rental period.</li>\r\n                                    <li>A cleaning charge will apply if items are not returned clean.</li>\r\n                                    <li>A damage charge will apply if any item is found damaged after return.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Payment</li></h4>\r\n                                <ul>\r\n                                    <li>Payment must be made according to the agreed terms.</li>\r\n                                    <li>Event Kaboodles LLC currently accepts cash and Zelle payments only.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Cancellation</li></h4>\r\n                                <ul>\r\n                                    <li>Cancellations must be made in writing and are subject to the following cancellation fees:</li>\r\n                                    <ul>\r\n                                        <li>7 days or more before the event: Deposit only (25% of total rental cost).</li>\r\n                                        <li>Less than 7 days before the event: 50% of the total rental cost.</li>\r\n                                    </ul>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Liability</li></h4>\r\n                                <ul>\r\n                                    <li>Event Kaboodles LLC is not liable for any injury, damage, or loss incurred during the use of rented equipment.</li>\r\n                                    <li>The customer assumes all responsibility for the safe and proper use of rented equipment.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Insurance</li></h4>\r\n                                <ul>\r\n                                    <li>It is the customer\'s responsibility to obtain any necessary insurance coverage for the event and rented equipment.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Force Majeure</li></h4>\r\n                                <ul>\r\n                                    <li>Event Kaboodles LLC is not liable for any failure to perform due to circumstances beyond our control, including but not limited to acts of nature, government restrictions, and supplier delays.</li></ul></section><section><li>Governing Law</li>\r\n                                <ul>\r\n                                    <li>This agreement is governed by the laws of the jurisdiction in which Event Kaboodles LLC is located.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Amendments</li>\r\n                            <ul>\r\n                                    <li>Event Kaboodles LLC reserves the right to amend these terms and conditions at any time. Customers will be notified of any changes.</li>\r\n                                </ul>\r\n                            </h4></section>\r\n                            <section>\r\n                                <h4><li>Termination</li></h4>\r\n                                <ul>\r\n                                    <li>Event Kaboodles LLC reserves the right to terminate this agreement and reclaim rented equipment if the customer breaches any terms or conditions.</li>\r\n                                </ul>\r\n                            </section>\r\n                            <section>\r\n                                <h4><li>Entire Agreement</li></h4>\r\n                                <ul>\r\n                                    <li>This agreement constitutes the entire understanding between Event Kaboodles LLC and the customer and supersedes all prior agreements and understandings.</li>\r\n                                </ul>\r\n                            </section>\r\n                        </section></ul>\r\n                        <p>\r\n                            By renting equipment from Event Kaboodles LLC, you acknowledge that you have read, understood, and agreed to these terms and conditions. Please contact us if you have any questions or require clarification.\r\n                        </p>\r\n                    </main>', '2025-01-06 06:09:28', '2025-12-16 10:54:26'),
(4, 'cancellation-policy', 'Cancellation Policy', '<div class=\"cancellation-policy-page\">\n                    <section class=\"hero bg-dark text-white text-center py-5\">\n                        <div class=\"container\">\n                            <h1 class=\"display-4 fw-bold\">Cancellation Policy</h1>\n                            <p class=\"lead mt-3\">Your Guide to Hassle-Free Cancellations</p>\n                        </div>\n                    </section>\n\n                    <section class=\"introduction py-5 bg-light\">\n                        <div class=\"container\">\n                            <div class=\"row align-items-center\">\n                                <div class=\"col-md-6\">\n                                    <img src=\"/assets/images/cancellation-policy.jpg\" alt=\"Cancellation Policy\" class=\"img-fluid rounded\">\n                                </div>\n                                <div class=\"col-md-6\">\n                                    <h2 class=\"mb-4\">Understanding Our Policy</h2>\n                                    <p>\n                                        We aim to provide flexibility to our customers while ensuring fairness to everyone involved. This policy outlines the procedures and terms for cancellations of orders, subscriptions, or services.\n                                    </p>\n                                    <a href=\"#policy-details\" class=\"btn btn-primary mt-3\">Learn More</a>\n                                </div>\n                            </div>\n                        </div>\n                    </section>\n\n                    <section id=\"policy-details\" class=\"policy-details py-5\">\n                        <div class=\"container\">\n                            <div class=\"row text-center\">\n                                <div class=\"col-md-6 mb-4\">\n                                    <div class=\"card border-0 shadow-sm\">\n                                        <div class=\"card-body\">\n                                            <h3 class=\"card-title\">Order Cancellations</h3>\n                                            <p class=\"card-text\">\n                                                You may cancel your order within 24 hours of placement for a full refund. After 24 hours, cancellations may be subject to additional charges.\n                                            </p>\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"col-md-6 mb-4\">\n                                    <div class=\"card border-0 shadow-sm\">\n                                        <div class=\"card-body\">\n                                            <h3 class=\"card-title\">Subscription Cancellations</h3>\n                                            <p class=\"card-text\">\n                                                Subscriptions can be canceled at any time. However, refunds will only be provided if the cancellation occurs within the first 14 days of the subscription period.\n                                            </p>\n                                        </div>\n                                    </div>\n                                </div>\n                            </div>\n                        </div>\n                    </section>\n\n                    <section class=\"refund-policy bg-light py-5\">\n                        <div class=\"container text-center\">\n                            <h2 class=\"mb-4\">Refunds and Adjustments</h2>\n                            <p>\n                                Refunds for cancellations are processed within 7-10 business days. Any adjustments or exceptions to this policy are at the discretion of our support team.\n                            </p>\n                            <img src=\"/assets/images/refund.jpg\" alt=\"Refund Policy\" class=\"img-fluid rounded mt-3\">\n                        </div>\n                    </section>\n\n                    <section class=\"exceptions py-5\">\n                        <div class=\"container\">\n                            <h2 class=\"text-center mb-4\">Exceptions and Special Cases</h2>\n                            <p class=\"text-center\">\n                                Some services and products are non-refundable due to their nature (e.g., digital goods, customized items). Please check the specific terms for such products or services.\n                            </p>\n                            <div class=\"text-center mt-3\">\n                                <img src=\"/assets/images/exceptions.jpg\" alt=\"Exceptions and Special Cases\" class=\"img-fluid rounded\" style=\"max-width: 50%;\">\n                            </div>\n                        </div>\n                    </section>\n\n                    <section class=\"contact bg-dark text-white text-center py-5\">\n                        <div class=\"container\">\n                            <h2 class=\"mb-4\">Need More Information?</h2>\n                            <p class=\"lead\">If you have any questions about our cancellation policy, feel free to contact us.</p>\n                            <a href=\"/contact\" class=\"btn btn-outline-light mt-3\">Contact Us</a>\n                        </div>\n                    </section>\n                </div>', '2025-01-06 06:09:28', '2025-01-06 06:09:28');
